// src/components/SignUpPage.js
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './SignUpPage.css'; // Make sure to import the CSS file

const SignUpPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleSignUp = (e) => {
    e.preventDefault();
    // Add your sign-up logic here
    navigate('/login');
  };

  return (
    <div className="container">
      <div className="row m-5 no-gutters shadow-lg">
        <div className="col-md-6 d-none d-md-block">
          <img
            src="https://images.unsplash.com/photo-1566888596782-c7f41cc184c5?ixlib=rb-1.2.1&auto=format&fit=crop&w=2134&q=80"
            className="img-fluid"
            style={{ minHeight: '100%' }}
            alt="Sign Up Background"
          />
        </div>
        <div className="col-md-6 bg-white p-5">
          <h2>Sign Up</h2>
          <form onSubmit={handleSignUp}>
            <div className="form-group pb-3">
              <input
                type="text"
                placeholder="Username"
                className="form-control"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>
            <div className="form-group pb-3">
              <input
                type="password"
                placeholder="Password"
                className="form-control"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <button type="submit" className="btn btn-primary w-100 font-weight-bold mt-2">
              Sign Up
            </button>
          </form>
          <div className="pt-4 text-center">
            Already have an account? <Link to="/login" className="btn btn-link">Login</Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignUpPage;
